(13, '13', 1, 1, '2015-07-21 05:39:10', 'The Basement Tapes is a studio album by American singer-songwriter Bob Dylan and the Band, released on June 26, 1975 by Columbia Records. It is Dylan''s sixteenth studio album. The songs featuring Dylan''s vocals were recorded in 1967, eight years before the album''s release, at houses in and around Woodstock, New York, where Dylan and the Band lived. Although most of the Dylan songs had appeared on bootleg records, The Basement Tapes marked their first official release.\n\nDuring his world tour of 196566, Dylan was backed by a five-member rock group, the Hawks, who would subsequently become famous as the Band. After Dylan was reportedly injured in a motorcycle accident in July 1966, four members of the Hawks gravitated to the vicinity of Dylan''s home in the Woodstock area to collaborate with him on music and film projects. While Dylan was concealed from the public''s gaze during an extended period of "convalescence" in 1967, they recorded more than 100 tracks together, comprising original compositions, contemporary covers and traditional material. Dylan''s new style of writing moved away from the urban sensibility and extended narratives that had characterized his most recent albums, Highway 61 Revisited and Blonde on Blonde, toward songs that were more intimate and which drew on many styles of traditional American music. While some of the basement songs are humorous, others dwell on nothingness, betrayal and a quest for salvation. In general, they possess a rootsy quality anticipating the Americana genre. For some critics, the songs on The Basement Tapes, which circulated widely in unofficial form, mounted a major stylistic challenge to rock music in the late sixties.', '2015-07-21 18:30:00', 0, 'leads', 0, 12, NULL),
