(9, 'JYOTI ', 'BHATTACHARYA', '8981868429', '', 'Dear Sir,\n\nI am Jyoti Bhattacharya, MBA(Marketing+Syetems) 2012 ,Btech(CSE) 2010 want to serve your company and fulfill my aim to prove my excellence.\nI have attached my resume,please find below the same.\n\nAggregate in MBA: 64.3(1st sem)\n Specialization in MBA:Marketing (major) , Systems(minor)\n Expected Salary(CTC):3.5\n Current Location:kolkata\nPreferred Location : Bangalore,Kolkata\nJoining Period: April  2012\n\nRegards,\n JYOTI BHATTACHARYA\nmob: +91 8981868429', 'jyotisoftwares@gmail.com', 'asp dot net', 'career20120408114050Jyoti Bhattacharya _Resume.doc'),
(10, 'ashish', 'vishwakarma', '8800874950', '', 'I hereby request you to go through my Bio-Data for your\nkind perusal. I assure you that I deliver the expected results and\ndemonstrate a very high degree of discipline and team-spirit.', 'ashish_vishwakarma@live.com', 'seo sem', 'career20120418173545converted.doc'),
