(13, 'Naveen', 'Balakrishnan', '919886367113', '918023652257', 'Over 10 years of experience in Marketing and Public relations competency.\n* Carrying an international work experience, having worked in Dubai and Malaysia.\n* PGDM (MBA) in Marketing & Information Technology from Institute of Finance and International Management (IFIM Business School)\n* Experienced in Copy writing, content writing, business development and media relations for various companies.\n* Delivered market research projects for Gartner, IDC, Frost & Sullivan across various industries like Telecom, IT, Health care and automobile processes.\n', 'naveenbalakrishnan@yahoo.com', 'MarCom', 'career20120601141105Naveen.doc'),
(14, 'Mayur', 'Chauhan', '9654003924', '22383572', 'since last 1.5 year exp in realestate clients.', 'mayur12@live.com', 'ERP CRM', 'career20120612113758Mayur.resume.doc'),
