(17, 'suresh', 'joshi', '919015274970', '05946267512', '	Analyze the number of visitors to a website and their activity on the site\n	Make changes to a website to improve its ranking on Google, Yahoo!, etc\n	promote a website on blogs, forums and wikis\n	understand issues surrounding user experience, accessibility and information architecture\n	Keyword Research using Google Adwords Keyword Tool, Word tracker & Keyword Discovery.\n	Suggest Primary, Secondary & Tertiary Keywords.\n	Prepare Keyword Ranking reports.\n	Mobile Directory search & submissions\n	Site submission to the directories, Link building. submissions\n	Submitting website to major search engines to get crawled & indexed by search engine crawlers\n	Blog Submission as part of Off Page Optimization\n	Article Submission as part of Off Page Optimization\n	Directory Submission & social bookmarking\n', 'sureshjoshi85@gmail.com', 's e o ', 'career20120706133129sureshseo.doc'),
