(19, 'SARVAJEET', 'SINGH BHATIA', '9540704170', '', 'Hi This is Sarvajeet Singh. I Have done MCA(2012). I am Fresher but our career objective is To secure a challenging position where I can effectively contribute my skills as Software Professional, possessing competent Technical Skills. "There is always a better way of doing things" is the common belief.', 'hsarbjeet@rediffmail.com', 'SEO ASP SQL', 'career20120708194254Sarvajeet_Singh_Bhatia.doc'),
