(27, 'pankaj', 'tiwari', '9311603615', '', 'Hi / Hello Sir,\nI am Panakj Tiwari. I am  UPite, born in Bihar  Mine is a nuclear family.\nMy fathers name is Mr. Ram Kumar Tiwari and he is a farmer. \nMy mothers name is Mrs. Renu Kumari and she is a Gorvent Teacher. \nI did my Masters in Computer Application from Nagpur University. \nRecently I worked on live project with Saiwebtel technology Company in Gurgaao.', 'pankajtiwari.raj@gmail.com', 'Core PHP', 'career20120815121105Resume .doc'),
(28, 'Nikhil', 'Maggu', '9999652230', '', '- 4 years experience in "Contact Center & Unified Communications" & "VAS"\n\n- Program development and support experience from small performance sensitive real time subsystems to large systems integrating network and database components.\n\n- System and application experience in open source software of all sizes.\n\nSpecialties\n- IP & Voice Networks (VOIP) - IP Telephony\n- Protocols & Technology - VOIP, SIP, ZAP, ISDN - PRI, Q.931, TCP/IP, RTP, SMPP\n- Asterisk - AGI, AMI, Kannel\n- Scripting - Shell/Bash Script\n- PostgreSql and MySql\n- CTI & Application Development - PHP\n- Subscription Billing - EMM & UCIP, CDR Billing.\n- Routing & Switching, LAN/WAN\n- Client Relationship Management\n- Quick Learner/Flexible/Inquisitive\n- Domain Knowledge/Deadline Oriented\n- Team Building, Project Management, Mentoring and Leadership', 'nikhil_maggu@yahoo.co.in', 'IP Telephony', 'career20120816165250Nikhil_Maggu_CV.doc'),
(29, 'akshay', 'teotia', '9999725735', '01204120752', 'Successfully handling a team with 6 year Exprience', 'star_akshay@hotmail.com', '7 year', 'career20120918112621Akshay Teotia [Resume].doc'),
